import { useParams } from "react-router-dom";
import { useEffect, useState } from "react";
import axios from "axios";

// Components
import { Footer } from "../Components/Footer";
import { Header } from "../Components/Header";
import { Form } from "../Components/Sign Up/Form";

// Interface

// Sign Up Form data
interface SignUpFormData {
  title: string;
  description: string;
  formTag1: string;
  formTag2: string;
  formTag3: string;
}

export const SignUp = () => {
  const [signUpFormType, setSignUpFormType] = useState<SignUpFormData>({
    title: "",
    description: "",
    formTag1: "",
    formTag2: "",
    formTag3: "",
  });
  const [signUpIcon, setSignUpIcon] = useState("");

  const parameters: string | undefined = useParams().user;

  useEffect(() => {
    if (parameters === "business") {
      fetch("../Json/SignUp.json")
        .then((res) => res.json())
        .then((data: any) => {
          setSignUpFormType(data.business);
        });
    } else if (parameters === "mentor") {
      axios
        .get("./Json/SignUp.json")
        .then((res) => setSignUpFormType(res.data.mentor));
    } else if (parameters === "hr") {
      axios
        .get("./Json/SignUp.json")
        .then((res) => setSignUpFormType(res.data.hr));
    } else {
    }
  }, []);

  return (
    <section>
      <Header />
      <main>
        <section className="form-section">
          <Form {...signUpFormType} />
        </section>
        <section className="icon-section"></section>
      </main>
      <Footer />
    </section>
  );
};
